import { Flex, Text, Center, Image } from "@chakra-ui/react";
import logo from '../logo.png'

export const Header = () => {
  return (
    <Flex color='white' justifyContent>
      <Center w='100%' bg='white' boxShadow='base' h='100px'>
        <Image src={logo} boxSize='250px' alt='Dan Abramov' />

      </Center>
    </Flex>

  )
}
